import { useState, useEffect } from 'react'

import Input from '../form/Input'
import Select from '../form/Select'
import SubmitButton from '../form/SubmitButton'
import styles from './CadastroForm.module.css'

export default function CadastroFormVagas({handledSubmit, vagasData, btntext}){
    const [vaga, setVaga] = useState(vagasData || {})

    const submit = (e) => {
        e.preventDefault()
        handledSubmit(vaga)
        //limpar()
    }

    function handleChange(e){
        setVaga({...vaga, [e.target.name]: e.target.value})
    }

    return (
        <form onSubmit={submit} className={styles.form}>
            <div className="row">
                <div className="col-md-4">
                    <Input type="text" text="Nome do candidato" id="name" name="name" placeholder="Insira o nome completo do candidato" handleOnChange={handleChange} value={candidato.name ? candidato.name:''} />
                </div>
            
            </div>
        </form>
    ) 
}
